import React from "react";

const Header = () => {

    return (
        <header>
            <h1>Mi Tiendita OnLine</h1>
            <p>Inicio</p>
            <p>Ofertas</p>
            <p>Nosotros</p>
            <p>Ayuda</p>
        </header>
    )
}

export default Header;
